import React from 'react';

import Test_Plot_Dates from './Test_Plot_Dates';

class Plot extends React.PureComponent {
    constructor(props) {
        super(props);
        this.childRef = React.createRef();
    }

    componentDidMount() {
      this.childRef.current.focus();
    }

    render() {
      return (
        <div>
            <Test_Plot_Dates ref={this.childRef} options={this.props.options} historical_data={this.props.historical_data} forecasted_data={this.props.forecasted_data} number_of_series={this.props.forecasted_data.length} keywords={this.props.keywords} />
        </div>
      );
    }
  }

  export default Plot;
